from flask import Flask
from flask_restful import Resource, Api

app = Flask(__name__)
api = Api(app)

def deco1(f):
    def wrapper(*args, **kwargs):
        print(&apos;deco1&apos;)
        return f(*args, **kwargs)

    return wrapper


def deco2(f):
    def wrapper(*args, **kwargs):
        print(&apos;deco2&apos;)
        return f(*args, **kwargs)

    return wrapper


class DemoResource(Resource):
    # &#x901A;&#x8FC7;method_decorators&#x7C7B;&#x5C5E;&#x6027;&#x6765;&#x8BBE;&#x7F6E;&#x7C7B;&#x89C6;&#x56FE;&#x7684;&#x88C5;&#x9970;&#x5668;
