    method_decorators = {&apos;get&apos;: [deco1], &apos;post&apos;: [deco2]}  # &#x5B57;&#x5178;&#x5F62;&#x5F0F; &#x7ED9;&#x8BF7;&#x6C42;&#x65B9;&#x5F0F;&#x5206;&#x522B;&#x8BBE;&#x7F6E;&#x88C5;&#x9970;&#x5668;

    # @deco2
    # @deco1
    def get(self):
        return {&apos;foo&apos;: &quot;get&quot;}

    def post(self):
        return {&apos;foo&apos;: &quot;post&quot;}


api.add_resource(DemoResource, &apos;/&apos;)


if __name__ == &apos;__main__&apos;:
    app.run(debug=True)


